import "./NavBar.css";
import { NavLink } from "react-router";


function NavBar() {
  return (
    <nav id="header">
      <NavLink to="/" end>
        Home
      </NavLink>

      <NavLink to="/category" end>
        Category
      </NavLink>

      <NavLink to="/products" end>
        Products
      </NavLink>


      <div id="search">
        <input type="text" id="query" placeholder="Search"></input>
        <button>Search</button>
      </div>
    </nav>
  );
}
export default NavBar;
